      table = ["\uC232 \uBCA0\uB9AC \uB530\uAE30: \uC5EC\uB7EC\uBD84\uC740 \uBCA0\uB9AC\uAC00 \uC5F4\uB9B0 \uC218\uD480\uC744 \uBC1C\uACAC\uD55C\uB2E4. \uD0D0\uC0C9\uC744 \uD558\uB294 PC\uB294 \uB09C\uC774\uB3C4 8\uC758 [\uC9C0\uAC01\uD310\uC815]\uC744 \uD55C\uB2E4(\uD55C \uBA85\uB2F9 1\uD68C\uB9CC). \uC131\uACF5\uD55C \uC0AC\uB78C\uC740 \u300C\uC232 \uBCA0\uB9AC (\uB9D8\uB300\uB85C \uC0CC\uB4DC\uC704\uCE58\uC5D0 \uC0C1\uB2F9)\u300D\uB97C \uD558\uB098 \uC785\uC218\uD55C\uB2E4.", "\uB098\uBB47\uC78E \uC0AC\uC774\uB85C \uD587\uBE5B\uC774 \uBE44\uCE58\uB294 \uC0B0\uCC45\uAE38: \uB098\uBB47\uC78E \uC0AC\uC774\uB85C \uD587\uBE5B\uC774 \uBE44\uCE58\uB294 \uBC1D\uC740 \uC7A1\uBAA9\uB9BC\uC774 \uC774\uC5B4\uC9C4\uB2E4. \uC801\uB2F9\uD788 \uC0AC\uB78C\uC758 \uC190\uC774 \uB2FF\uC544\uC11C \uC0B0\uCC45\uD558\uB294 \uAE30\uBD84\uC73C\uB85C \uAC78\uC744 \uC218 \uC788\uB2E4.", "\uAD70\uC0DD\uC9C0\uC5D0\uB294 \uC8FC\uC758: \uC5EC\uB7EC\uBD84\uC740 \uD2B8\uB9AC\uD53C\uB4DC\uC758 \uAD70\uC0DD\uC9C0\uC5D0 \uB4E4\uC5B4\uC624\uACE0 \uB9D0\uC558\uB2E4! \uD798\uACA8\uC6B4 \uC2F8\uC6C0 \uB05D\uC5D0 \uB2E4\uD589\uD788\uB3C4 \uC2B9\uB9AC\uB97C \uAC70\uBA38\uC950\uC5C8\uC9C0\uB9CC, \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 [\uD53C\uB85C: 10]\uC744 \uC785\uB294\uB2E4.", "\uD398\uC5B4 \uD2B8\uB808\uC774\uB4DC: \uC5EC\uB7EC\uBD84\uC740 \u3008\uB300\uC9C0\uC778\u3009 \uB18D\uBD80\uB97C \uB9CC\uB0AC\uB2E4. 20G\uB97C \uB0B4\uBA74 \u300C\uACC4\uC808\uC57C\uCC44 \uD3EC\uD1A0\uD440\u300D\uB97C \uAD6C\uC785\uD560 \uC218 \uC788\uB2E4(\uB2E4 \uD569\uCCD0\uC11C PC\uC640 \uAC19\uC740 \uC218\uAE4C\uC9C0).", "\uAC15\uC5D0\uC11C\uC758 \uC0B6: \uC81C\uBC29\uC744 \uB530\uB77C \uAC15 \uADFC\uCC98\uB97C \uAC77\uB294\uB2E4. \uC791\uC740 \uC120\uCC29\uC7A5\uC5D0\uC11C \uC704\uC138 \uC88B\uC740 \uBAA9\uC18C\uB9AC\uAC00 \uB4E4\uB9B0\uB2E4. \uBB3C\uACE0\uAE30\uB97C \uC7A1\uACE0 \uC788\uB294 \uBAA8\uC591\uC774\uB2E4.", "\uAC74\uB108\uB824 \uD574\uB3C4 \uAC74\uB110 \uC218 \uC5C6\uB294: \uAC15\uBB3C\uC774 \uBD87\uB294 \uBC14\uB78C\uC5D0 \uC5EC\uB7EC\uBD84\uC740 \uAC15\uC744 \uAC74\uB110 \uACF3\uC744 \uCC3E\uB290\uB77C \uACE0\uC0DD\uD55C\uB2E4. [\uC218\uC0DD] \uD0DC\uADF8\uB97C \uC18C\uC9C0\uD558\uACE0 \uC788\uAC70\uB098 \uC5BB\uC744 \uC218 \uC788\uB294 \uC218\uB2E8\uC774 \uC788\uB294 PC\uAC00 \uD55C \uBA85\uC774\uB77C\uB3C4 \uC788\uB2E4\uBA74 \uC544\uBB34 \uBB38\uC81C \uC5C6\uB2E4. \uC5C6\uB2E4\uBA74 \uBA40\uB9AC \uC6B0\uD68C\uD558\uC5EC \uC804\uC6D0 [\uD53C\uB85C: 10]\uC744 \uC785\uB294\uB2E4.", "\uCF54\uBCFC\uD2B8 \uC870\uC6B0\uC804: \uC5EC\uB7EC\uBD84\uC740 \uCF54\uBCFC\uD2B8 \uBB34\uB9AC\uB97C \uBB3C\uB9AC\uCCE4\uB2E4! \uC804\uC6D0 10G\uB97C \uC190\uC5D0 \uB123\uB294\uB2E4. \uCAD3\uC544\uAC00\uC11C \uC12C\uBA78\uD55C\uB2E4\uBA74 \uC804\uC6D0 [\uD53C\uB85C: 10]\uC744 \uC785\uB294 \uB300\uC2E0 \uCD94\uAC00\uB85C \u300C\uCF54\uBCFC\uD2B8\uC758 \uC774\uBE68 [\uD658\uC804](10G)\u300D\uB97C \uD55C \uC0AC\uB78C\uB2F9 1\uAC1C \uC190\uC5D0 \uB123\uB294\uB2E4.", "\uD48D\uC694\uB85C\uC6B4 \uC804\uC6D0 \uD48D\uACBD: \uD070 \uB17C\uC774 \uBA87 \uC790\uB9AC\uB098 \uD3BC\uCCD0\uC838 \uC788\uB2E4. \uAC00\uC744\uC774\uB77C\uBA74 \uD669\uAE08\uC0C9 \uBCBC \uC774\uC0AD\uC774 \uBC14\uB78C\uC5D0 \uD754\uB4E4\uB9B4 \uAC83\uC774\uB2E4.", "\uBD88\uC6B4\uD55C \uC608\uAC10: \uAC80\uC740 \uACE0\uC591\uC774\uAC00 \uB208\uC55E\uC744 \uAC00\uB85C\uC9C0\uB974\uACE0, \uAE4C\uB9C8\uADC0\uAC00 \uBA38\uB9AC \uC704\uC5D0\uC11C \uC6B8\uACE0, \uC2E0\uBC1C \uB048\uC774 \uB69D \uB04A\uC5B4\uC84C\uB2E4. \uC660\uC9C0 \uBAA8\uB97C \uD55C\uAE30\uAE4C\uC9C0. \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 \u3010\uC778\uACFC\uB825\u3011\uC744 1\uC810 \uC783\uB294\uB2E4.", "\uCE5C\uAD6C\uC758 \uCE5C\uAD6C\uB294 \uCE5C\uAD6C: PC \uC804\uC6D0\uC740 2D\uB97C \uAD74\uB9B0\uB2E4. \uAC00\uC7A5 \uD070 \uB208\uC774 \uB098\uC628 \u300C\uB2F9\uC2E0\u300D\uC740 \uAC00\uC7A5 \uC801\uC740 \uB208\uC774 \uB098\uC628 \u300C\uB300\uC0C1\u300D\uACFC \uACF5\uD1B5\uC758 \uC9C0\uC778\uC5D0 \uB300\uD55C \uD654\uC81C\uB85C \uC774\uC57C\uAE30\uAF43\uC744 \uD53C\uC6B4\uB2E4. \uB2F9\uC2E0\uACFC \uB300\uC0C1\uC740 \u300C\uC778\uACFC\uB825 \uD2F0\uCF13\u300D \uD55C \uC7A5\uC73C\uB85C \uAC01\uC790 \uC11C\uB85C\uC5D0 \uB300\uD55C \uCEE4\uB125\uC158\uC744 \uCDE8\uD560 \uC218 \uC788\uB2E4. \uAD00\uACC4\uB294\u300C\uC6B0\uC815, \uC774\uD574\u300D \uC911 \uD558\uB098\uAC00 \uB41C\uB2E4.", "\uC2DC\uAC04\uC740 \uD750\uB978\uB2E4: \uAE38\uC744 \uB530\uB77C \uC678\uBCBD\uB9CC \uB0A8\uC740 \uCCA0\uADFC \uBE4C\uB529\uC774 \uC11C \uC788\uB2E4. \uC9C0\uAE08\uC740 \uC0C8\uC758 \uB465\uC9C0\uAC00 \uB41C \uB4EF\uD558\uB2E4.", "\uAC11\uC791\uC2A4\uB7EC\uC6B4 \uD3ED\uC6B0!: \uC5EC\uB7EC\uBD84\uC740 \uAC11\uC791\uC2A4\uB7EC\uC6B4 \uD3ED\uC6B0\uB97C \uB9CC\uB098, \uACE0\uC0DD \uB05D\uC5D0 \uD3D0\uAC00\uC5D0 \uB3C4\uCC29\uD588\uB2E4. \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 [\uC2DD\uB7C9] \uC544\uC774\uD15C\uC744 \uD558\uB098 \uC18C\uBE44\uD574\uC57C \uD55C\uB2E4. \uB2E8, [\uD53C\uB85C] \uD68C\uBCF5\uB7C9\uC740 \uC808\uBC18\uC774\uB2E4. [\uC2DD\uB7C9] \uC544\uC774\uD15C\uC744 \uC18C\uBE44\uD560 \uC218 \uC5C6\uB294 \uACBD\uC6B0\uB294\u3010\uC778\uACFC\uB825\u3011 1\uC810\uC744 \uC783\uB294\uB2E4.", "\uB4E4\uAF43\uC774 \uB9CC\uBC1C\uD558\uB2E4: \uC5EC\uB7EC\uBD84\uC740 \uB113\uC740 \uAF43\uBC2D\uC5D0 \uB3C4\uCC29\uD55C\uB2E4. \uD0D0\uC0C9\uC744 \uD558\uB294 PC\uB294 \uBAA9\uD45C\uCE58 9\uC758 [\uC9C0\uC2DD\uD310\uC815\uC744 \uD55C\uB2E4(\uD55C \uBA85\uB2F9 1\uD68C\uB9CC). \uC131\uACF5\uD55C \uC0AC\uB78C\uC740 \u300C\uADC0\uC911\uD55C \uC57D\uCD08 [\uD658\uC804] (20G)\u300D\uB97C \uD558\uB098 \uC785\uC218\uD55C\uB2E4.", "\uB179\uC0C9 \uD130\uB110: \uBA4B\uC9C4 \uD560\uC5FD\uC218\uAC00 \uB098\uB780\uD788 \uB298\uC5B4\uC11C\uC11C \uB179\uC0C9\uC758 \uCC9C\uC7A5\uC744 \uC774\uB8E8\uACE0 \uC788\uB2E4. \uBC1C\uCE58\uC5D0\uB294 \uBD80\uC5FD\uD1A0\uAC00 \uB450\uAECD\uAC8C \uAE54\uB838\uACE0, \uACF3\uACF3\uC5D0\uC11C \uB098\uBB34\uBFCC\uB9AC\uAC00 \uBAA8\uC2B5\uC744 \uB4DC\uB7EC\uB0B4\uACE0 \uC788\uB2E4.", "\uACE0\uBE14\uB9B0 \uAC15\uC2B5 \uBD80\uB300: \uC5EC\uB7EC\uBD84\uC740 \uACE0\uBE14\uB9B0 \uAC15\uC2B5\uBD80\uB300\uC640\uC758 \uC870\uC6B0\uC804\uC5D0 \uD718\uB9D0\uB838\uB2E4. \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 [\uD53C\uB85C: 20]\uC744 \uC785\uAC70\uB098, \uB610\uB294 [\uC2DC\uB098\uB9AC\uC624n\uD68C]\uD615 \uD2B9\uAE30\uC758 \uC0AC\uC6A9\uD69F\uC218\uB97C \uC18C\uBE44\uD55C\uB2E4(\uC5EC\uB7EC\uBD84\uC774 \uC120\uD0DD).", "\uC815\uBCF4\uAD50\uD658: \uC5EC\uB7EC\uBD84\uC740 \uBAA8\uD5D8\uC790 \uC9D1\uB2E8\uACFC \uB9CC\uB0AC\uB2E4. \uB300\uD45C\uC790\uB294 \uBAA9\uD45C 10\uC758 [\uAD50\uC12D\uD310\uC815]\uC744 \uD55C\uB2E4(\uC801\uC808\uD55C \uC11C\uBE0C \uC9C1\uC5C5\uC774 \uC788\uB2E4\uBA74 +2\uC758 \uBCF4\uB108\uC2A4\uB97C \uC5BB\uC744 \uC218\uB3C4 \uC788\uB2E4). \uC131\uACF5\uD558\uBA74 \uBD80\uADFC\uC758 \uC815\uBCF4\uB97C \uB4E4\uC744 \uC218 \uC788\uB2E4. \uC5EC\uB7EC\uBD84 \uC911 \uD558\uB098\uB294 \uB2E4\uC74C\uC5D0 \uD558\uB294 [\uC815\uCC30] \uD589\uB3D9\uC5D0 +2\uB97C \uC5BB\uB294\uB2E4.", "\uBABB\uC758 \uC5B4\uBD80: \uBB3C\uC774 \uAC00\uB4DD\uD55C \uBABB\uC5D0 \uB098\uC654\uB2E4. \uC5B4\uBD80\uAC00 \uD22C\uB9DD\uC744 \uB358\uC9C0\uB294 \uBAA8\uC2B5\uC774 \uBCF4\uC778\uB2E4.", "\uD1A0\uB9C9\uB09C \uC0DB\uAE38: \uC0B0\uC0AC\uD0DC\uB85C \uAE38\uC774 \uBB34\uB108\uC838 \uB0B4\uB9AC\uACE0 \uB9D0\uC558\uB2E4. \uC774 \uAE38\uC740 \uC0AC\uC6A9\uD560 \uC218 \uC5C6\uC744 \uAC83 \uAC19\uB2E4. [\uBE44\uD589] \uC0C1\uD0DC\uC774\uAC70\uB098 [\uBE44\uD589] \uC0C1\uD0DC\uB97C \uC5BB\uC744 \uC218 \uC788\uB294 \uC218\uB2E8\uC744 \uAC00\uC9C4 PC\uAC00 \uD55C \uBA85\uC774\uB77C\uB3C4 \uC788\uB2E4\uBA74 \uC8FC\uBCC0\uC744 \uD0D0\uC0C9\uD560 \uC218 \uC788\uC73C\uBBC0\uB85C \uBB38\uC81C\uB294 \uC5C6\uB2E4. \uADF8\uB807\uC9C0 \uC54A\uB2E4\uBA74 \uC5EC\uB7EC\uBD84\uC740 \uC544\uC8FC \uBA40\uB9AC \uB3CC\uC544\uAC00\uC57C \uD55C\uB2E4. \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 [\uD53C\uB85C:25]\uB97C \uC785\uB294\uB2E4.", "\uCF54\uBCFC\uD2B8\uB97C \uBB3C\uB9AC\uCCD0\uB77C!: \uC5EC\uB7EC\uBD84\uC740 \uCF54\uBCFC\uD2B8 \uC21C\uCC30\uB300\uB97C \uBB3C\uB9AC\uCCE4\uB2E4. \uC804\uC6D0 [\uD53C\uB85C: (1D6+5)]\uB97C \uC785\uB294 \uB300\uC2E0, \uC804\uB9AC\uD488\uC73C\uB85C 1\uC778\uB2F9 20G\uB97C \uC785\uC218\uD55C\uB2E4.", "\uB300\uC9C0\uC758 \uC740\uCD1D: \uC774\uB791\uC744 \uB530\uB77C \uCC44\uC18C\uC758 \uD30C\uB987\uD30C\uB987\uD55C \uC78E\uC774 \uBB34\uC131\uD558\uB2E4. \uB9DB\uC788\uB294 \uC694\uB9AC\uB97C \uB9CC\uB4E4 \uC218 \uC788\uC744 \uAC83 \uAC19\uB2E4.", "\uBBF8\uB044\uB7EC\uC838 \uAD74\uB7EC\uC11C: \uAC00\uB3C4\uB97C \uAC77\uACE0 \uC788\uB294\uB370 \uAC11\uC790\uAE30 \uAC70\uB300\uD55C \uC640\uC77C\uB4DC \uBCF4\uC5B4\uAC00 \uD280\uC5B4\uB098\uC628\uB2E4. \uD53C\uD558\uB358 \uCC30\uB098\uC5D0 \uB118\uC5B4\uC838\uC11C \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 [\uC18C\uBAA8\uD488] \uC544\uC774\uD15C\uC744 \uD558\uB098 \uC783\uB294\uB2E4. [\uC18C\uBAA8\uD488]\uC544\uC774\uD15C\uC744 \uAC00\uC9C0\uACE0 \uC788\uC9C0 \uC54A\uB2E4\uBA74 \u3010\uC778\uACFC\uB825\u3011 1\uC810\uC744 \uC783\uB294\uB2E4.", "\uBE59\uAE00\uBE59\uAE00 \uAF48\uB2F9: PC \uC804\uC6D0\uC740 2D\uB97C \uAD74\uB9B0\uB2E4. \uAC00\uC7A5 \uC791\uC740 \uB208\uC758 \u300C\uB2F9\uC2E0\u300D\uC740 \uC816\uC740 \uD480\uC5D0 \uBC1C\uC774 \uBBF8\uB044\uB7EC\uC838 \uAD74\uB7EC\uB5A8\uC5B4\uC9C0\uACE0 \uB9CC\uB2E4. \uAD6C\uD574\uC900 \uB3D9\uB8CC\uB294 \u300C\uC778\uACFC\uB825 \uD2F0\uCF13\u300D \uD55C \uC7A5\uC73C\uB85C \u300C\uB2F9\uC2E0\u300D\uC5D0 \uB300\uD574 \uCEE4\uB125\uC158\uC744 \uC5BB\uC744 \uC218 \uC788\uB2E4. \uAD00\uACC4\uB294 \u300C\uBE44\uD638, \uCE5C\uC560\u300D \uC911 \uD558\uB098\uAC00 \uB41C\uB2E4.", "\uBB34\uC778\uB4E4\uC774 \uAFBC \uAFC8\uC758 \uD754\uC801: \uBC18\uCBE4 \uBB34\uB108\uC9C4 \uB3CC\uB2F4\uC774 \uC774\uC5B4\uC9C4\uB2E4. \uC544\uC778\uACFC\uC758 \uACA9\uB82C\uD55C \uC2F8\uC6C0\uC758 \uD754\uC801\uB3C4 \uC9C0\uAE08\uC740 \uD76C\uBBF8\uD558\uAC8C \uB0A8\uC544\uC788\uC744 \uBFD0\uC774\uB2E4.", "\uC624\uB9AC\uBB34\uC911: \uC9D9\uC740 \uC548\uAC1C\uAC00 \uB080\uB2E4. \uD314\uC744 \uBED7\uC73C\uBA74 \uC190\uB05D\uC774 \uC548 \uBCF4\uC77C \uC815\uB3C4\uB2E4. \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 [\uD53C\uB85C: 25]\uB97C \uC785\uAC70\uB098 \u3010\uC778\uACFC\uB825\u3011 1\uC810\uC744 \uC783\uB294\uB2E4(\uC5EC\uB7EC\uBD84\uC774 \uC120\uD0DD).", "\uCE58\uC720\uC758 \uC0D8\uBB3C: \uC5EC\uB7EC\uBD84\uC740 \uC138\uCC28\uAC8C \uC19F\uAD6C\uCE58\uB294 \uB9D1\uC740 \uBB3C\uC744 \uBC1C\uACAC\uD55C\uB2E4. \uBAA9\uD45C\uCE58 13\uC758 [\uC9C0\uAC01\uD310\uC815]\uC744 \uD55C\uB2E4. \uB204\uAD6C\uB4E0 \uD55C \uBA85\uC774\uB77C\uB3C4 \uC131\uACF5\uD558\uBA74 \uC774\uAC83\uC774 \uB9E4\uC6B0 \uB9D1\uC73C\uBA70 \uB9C8\uB825\uC774 \uC788\uB294 \uBB3C\uC774\uB77C\uB294 \uAC83\uC744 \uC54C\uAC8C \uB41C\uB2E4. \uAE38\uC5B4 \uB2F4\uC544\uAC08 \uC218\uB294 \uC5C6\uC9C0\uB9CC, \uB9C8\uC2DC\uBA74 \uC989\uC11D\uC5D0\uC11C \u3010\uC778\uACFC\uB825\u3011 1\uC810\uC744 \uC5BB\uB294\uB2E4.", "\uCE68\uC5FD\uC218 \uC232: \uCE68\uC5FD\uC218\uAC00 \uC6B8\uD241\uBD88\uD241\uD55C \uB098\uBB34\uAECD\uC9C8\uC744 \uB4DC\uB7EC\uB0B4\uACE0 \uC788\uB2E4. \uADF8\uB298\uC5D0 \uC7A1\uCD08\uAC00 \uC801\uC5B4 \uC870\uAE08 \uC300\uC300\uD55C \uC778\uC0C1\uC744 \uBC1B\uB294\uB2E4.", "\uC5B4\uC778\uC758 \uC2B5\uACA9: \uC5EC\uB7EC\uBD84\uC740 \uC0AC\uD558\uAE34 \uC21C\uCC30\uC18C\uB300\uC640 \uACA9\uB82C\uD55C \uC2F8\uC6C0\uC744 \uBC8C\uC600\uB2E4! \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 [\uD53C\uB85C: 25]\uB97C \uC785\uAC70\uB098 [\uC18C\uBAA8\uD488] \uC544\uC774\uD15C 2\uAC1C\uB97C \uC783\uB294\uB2E4(\uC5EC\uB7EC\uBD84\uC774 \uC120\uD0DD).", "\uC0C1\uBD80\uC0C1\uC870: \uC5EC\uB7EC\uBD84\uC740 \uAF3C\uC9DD\uB3C4 \uBABB \uD558\uACE0 \uC11C \uC788\uB294 \uB9C8\uCC28\uC5D0 \uD0C4 \uC5EC\uD589\uC790\uB97C \uB9CC\uB0AC\uB2E4. \uADF8\uB4E4\uC744 \uB3D5\uB294 \uACBD\uC6B0, \uB3C4\uC6B0\uB824\uB294 \uBA64\uBC84 \uC804\uC6D0\uC774 [\uC870\uC791\uD310\uC815]\uC744 \uD55C\uB2E4. \uB2EC\uC131\uCE58 \uD569\uACC4\uAC00 (PC \uC218\u217910)\uC774\uC0C1\uC774\uB77C\uBA74 \uB9C8\uCC28\uB97C \uAE38\uC5D0 \uB418\uB3CC\uB9B0\uB2E4. \uADF8 \uACBD\uC6B0 1\uC778\uB2F9 20G\uC758 \uC0AC\uB840\uAE08\uC744 \uBC1B\uB294\uB2E4.", "\uC2DC\uB0C7\uBB3C\uACFC \uC0B0\uB4E4\uBC14\uB78C: \uC794\uC794\uD558\uAC8C \uD750\uB974\uB294 \uC791\uC740 \uC2DC\uB0C7\uAC00\uB85C \uB098\uC654\uB2E4. \uC218\uBA74\uC744 \uC2A4\uCCD0 \uC9C0\uB098\uAC00\uB294 \uC0B0\uB4E4\uBC14\uB78C\uC5D0 \uAE30\uBD84\uC774 \uC0C1\uCF8C\uD558\uB2E4.", "\uD30C\uC774\uD305 \uC77C\uBC1C!: \uC5EC\uB7EC\uBD84\uC740 \uC808\uBCBD\uC744 \uB530\uB77C \uB09C \uC881\uC740 \uD1B5\uB85C\uB97C \uB098\uC544\uAC00\uB290\uB77C \uCCB4\uB825\uB9CC\uC774 \uC544\uB2C8\uB77C \uAE30\uB825\uAE4C\uC9C0 \uC18C\uBAA8\uD55C\uB2E4. \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 [\uD53C\uB85C:15]\uB97C \uC785\uB294\uB2E4. \uAC70\uAE30\uC5D0 \uB354\uD558\uC5EC [\uD53C\uB85C: 15]\uB97C \uC785\uAC70\uB098 \u3010\uC778\uACFC\uB825\u3011 1\uC810\uC744 \uC783\uB294\uB2E4(\uC5EC\uB7EC\uBD84\uC774 \uC120\uD0DD).", "\uAC70\uC778\uACFC \uB9CC\uB098\uB2E4: \uC232 \uC704\uB85C \uBD88\uC465 \uBA38\uB9AC\uB97C \uB0B4\uBBFC \uAC83\uC740 \uB300\uBA38\uB9AC \uAC70\uC778\uC774\uC5C8\uB2E4. \uC804\uD22C\uC5D0 \uC2B9\uB9AC\uD55C \uC5EC\uB7EC\uBD84\uC740 \uC804\uC6D0 25G\uB97C \uC785\uC218\uD55C\uB2E4. \uAC70\uC778\uC758 \uBCF4\uAE08\uC790\uB9AC\uB97C \uCC3E\uC73C\uB824\uBA74 \uB300\uD45C\uC790\uAC00 \uBAA9\uD45C\uCE58 12\uC758 [\uD574\uC11D\uD310\uC815]\uC5D0 \uC131\uACF5\uD574\uC57C \uD55C\uB2E4. \uC131\uACF5\uD55C \uACBD\uC6B0 \uAC70\uC778\uC758 \uBCF4\uAE08\uC790\uB9AC\uC5D0\uC11C [\uB9C8\uCD09\uB9E46]\uC744 1D6+1\uAC1C \uC785\uC218\uD55C\uB2E4.", "\uD734\uC2DD \uC7A5\uC18C: \uC26C\uAE30 \uB531 \uC88B\uC740 \uB3C4\uB85C \uAC00\uC758 \uACF5\uD130\uB97C \uBC1C\uACAC\uD55C\uB2E4. \uC608\uC804\uC5D0 \uB204\uAD70\uAC00 \uAC19\uC740 \uC0DD\uAC01\uC744 \uD55C \uC0AC\uB78C\uC774 \uC788\uC5C8\uB294\uC9C0 \uBAA8\uB2E5\uBD88\uC744 \uD53C\uC6B4 \uD754\uC801\uB3C4 \uC788\uB2E4.", "\uADF8\uB7F4 \uB9AC\uAC00: \uAE38\uC744 \uC783\uACE0 \uB9D0\uC558\uB2E4. \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 \u3010\uC778\uACFC\uB825\u3011\uC744 2\uC810 \uC783\uB294\uB2E4. \u3010\uC778\uACFC\uB825\u3011\uC744 \uC783\uC744 \uC218 \uC5C6\uB294 \uACBD\uC6B0, \uBD80\uC871\uD55C \u3010\uC778\uACFC\uB825\u3011 1\uC810\uB2F9 [\uD53C\uB85C: 15]\uB97C \uC785\uB294\uB2E4. \uC5EC\uB7EC\uBD84\uC758 \uB3D9\uB8CC\uC911\uC5D0 [\uC9C0\uB3C4 \uC81C\uC791\uC790]\uB098 [\uCC99\uD6C4]\uAC00 \uC788\uB2E4\uBA74 [\uD53C\uB85C: 15]\uB294 [\uD53C\uB85C: 10]\uC73C\uB85C \uADF8\uCE5C\uB2E4.", "\uC88B\uC544\uD558\uB294 \uC560 \uC788\uC5B4?: \uBB34\uC2A8 \uC601\uBB38\uC778\uC9C0 \uC5EC\uB7EC\uBD84\uC740 \uD734\uC2DD \uC911\uC5D0 \uC88B\uC544\uD558\uB294 \uC774\uC131\uC5D0 \uB300\uD55C \uD654\uC81C\uC5D0 \uB3CC\uC785\uD558\uACE0 \uB9D0\uC558\uB2E4. [\uC560\uC815] \uB610\uB294 [\uC0AC\uB791], [\uC124\uB818]\uC5D0 \uC900\uD558\uB294 \uCEE4\uB125\uC158\uC744 \uAC00\uC9C0\uACE0 \uC788\uB294 PC\uB294 \uADF8 \uC0AC\uC2E4\uC744 \uACE0\uBC31\uD560 \uC218 \uC788\uB2E4. \uADF8 \uACBD\uC6B0, GM\uC740 \uADF8 PC\uC758 \uC6A9\uAE30\uC5D0 \uAE4A\uC774 \uAC10\uB3D9\uD558\uBA70\u3010\uC778\uACFC\uB825\u3011 1\uC810\uC744 \uC8FC\uC790. \uB9CC\uC57D \uACE0\uBC31 \uC0C1\uB300\uAC00 \uC9C0\uAE08 \uD30C\uD2F0\uC5D0 \uC788\uB294 \uB3D9\uB8CC\uB77C\uBA74, \uB864\uD50C\uB808\uC774\uC5D0 \uB530\uB77C\uC11C\uB294 \uADF8 \uC0C1\uB300\uC5D0\uAC8C\uB3C4 \uC900\uB2E4.", "\uC800 \uB2E4\uB9AC\uB97C \uAC74\uB108\uC11C: \uBD89\uAC8C \uB179\uC2A8 \uCCA0\uAD50\uAC00 \uAC15 \uC704\uB85C \uADF8\uB9BC\uC790\uB97C \uB4DC\uB9AC\uC6B0\uACE0 \uC788\uB2E4. \uC608\uC804\uC5D0\uB294 \uC804\uCC28\uAC00 \uC774 \uB2E4\uB9AC \uC704\uB97C \uAC74\uB11C\uB294\uC9C0 \uC774\uB07C \uC0AC\uC774\uB85C \uB808\uC77C\uC774 \uC5FF\uBCF4\uC778\uB2E4.", "\uC5BC\uC74C\uB369\uC5B4\uB9AC: \uD07C\uC9C1\uD55C \uC6B0\uBC15\uC774 \uB0B4\uB824 \uC0AC\uC815\uC5C6\uC774 \uC5EC\uB7EC\uBD84\uC744 \uB450\uB4E4\uAE34\uB2E4. \uC8FC\uC704\uB294 \uD0C1 \uD2B8\uC778 \uD1A0\uC9C0\uB77C\uC11C \uD53C\uD560 \uC218\uB3C4 \uC5C6\uB2E4. \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 [\uD53C\uB85C: 30]\uC744 \uC785\uB294\uB2E4.", "\uB450\uADFC\uB450\uADFC \uB3D9\uAD74: \uC5EC\uB7EC\uBD84\uC740 \uAE30\uBD84 \uB098\uC05C \uB3D9\uAD74\uC744 \uBC1C\uACAC\uD55C\uB2E4. \uD0D0\uC0C9\uC744 \uD558\uB294 PC\uB294 \uBAA9\uD45C\uCE58 12\uC758 [\uC9C0\uAC01\uD310\uC815]\uC744 \uD55C\uB2E4. \uC2E4\uD328\uD55C \uC0AC\uB78C\uC740 [\uD53C\uB85C: 10]\uC744 \uC785\uB294\uB2E4. \uD55C \uC0AC\uB78C\uC774\uB77C\uB3C4 \uC131\uACF5\uD55C \uACBD\uC6B0, \uB3D9\uAD74 \uC548\uC5D0\uC11C \uAE08\uD654 100G\uAC00 \uB4E4\uC5B4\uC788\uB294 \uC790\uB8E8\uB97C \uBC1C\uACAC\uD55C\uB2E4. \uACF5\uD3C9\uD558\uAC8C \uB098\uB204\uC790!", "\uC218\uD480\uC744 \uD5E4\uCE58\uACE0: \uB0AE\uC740 \uAD00\uBAA9\uC774 \uACF3\uACF3\uC5D0 \uC218\uD480\uC744 \uC774\uB8E8\uACE0 \uC788\uC5B4 \uB611\uBC14\uB85C \uC804\uC9C4\uD558\uAE30 \uD798\uB4E4\uB2E4.\uD558\uC9C0\uB9CC \uB204\uAD70\uAC00\uAC00 \uC9C0\uB098\uAC04 \uAE38\uC774 \uC788\uC5B4\uC11C \uD5E4\uB9E4\uC9C0 \uC54A\uACE0 \uB05D\uB0A0 \uAC83 \uAC19\uB2E4.", "\uC774\uACF3\uC5D0\uC11C \uC800\uC9C0\uD558\uB77C!: \uC5EC\uB7EC\uBD84\uC740 \u3008\uB300\uC9C0\uC778\u3009\uC758 \uB9C8\uC744 \uC8FC\uBCC0\uC5D0\uC11C \uC640\uC774\uBC88\uACFC\uC758 \uC804\uD22C\uC5D0 \uB3CC\uC785\uD588\uB2E4! \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 [\uD53C\uB85C: 30]\uC744 \uC785\uAC70\uB098 \u3010\uC778\uACFC\uB825\u3011 2\uC810\uC744 \uC783\uB294\uB2E4(\uC5EC\uB7EC\uBD84\uC774 \uC120\uD0DD).", "\uC5B8\uC820\uAC00 \uC9C0\uB098\uC628 \uAE38: \uC5EC\uB7EC\uBD84\uC740 \uC544\uC9C1 \uC2E0\uCD9C\uB0B4\uAE30\uC778 \u3008\uBAA8\uD5D8\uC790\u3009\uB4E4\uACFC \uB9CC\uB0AC\uB2E4. \uBB54\uAC00 \uB3C4\uC6C0\uC744 \uC8FC\uACE0 \uC2F6\uB2E4\uBA74 [\uC18C\uBAA8\uD488]\uC744 \uBA87 \uAC1C\uCBE4 \uAC74\uB124\uC904 \uC218\uB3C4 \uC788\uACE0, \uBB50\uB4E0 \uC870\uC5B8\uC744 \uD574\uC904 \uC218\uB3C4 \uC788\uB2E4. \uADF8\uB4E4\uC740 \uAC70\uB4ED \uAC10\uC0AC\uD558\uBA70 \uAE38\uC744 \uB5A0\uB09C\uB2E4. GM\uC740 PC\uB4E4\uC758 \uB864\uD50C\uB808\uC774\uC5D0 \uB530\uB77C \u3010\uC778\uACFC\uB825\u3011 1\uC810\uC744 \uC904 \uC218 \uC788\uB2E4.", "\uACC4\uACE1\uC5D0 \uC6B8\uB9AC\uB294 \uBB3C\uC18C\uB9AC: \uAC00\uD30C\uB978 \uACE8\uC9DC\uAE30 \uBC11\uC5D0\uC11C \uAE30\uC138 \uC88B\uAC8C \uBB3C\uC774 \uD750\uB978\uB2E4. \uADF8\uB9AC \uBA40\uC9C0\uC54A\uC740 \uACF3\uC5D0\uC11C \uD3ED\uD3EC \uC18C\uB9AC\uAC00 \uB4E4\uB824\uC628\uB2E4.", "\uB3C5 \uB2AA: \uC5EC\uB7EC\uBD84\uC740 \uC369\uC740 \uB0B4\uAC00 \uD48D\uAE30\uB294 \uB2AA\uC9C0\uB97C \uAC00\uB85C\uC9C8\uB800\uB2E4. \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 \uBAA9\uD45C\uCE58 14\uC758 [\uC6B4\uB3D9\uD310\uC815]\uC744 \uD574\uC57C \uD55C\uB2E4. \uC2E4\uD328\uD55C PC\uB294 [\uC18C\uBAA8\uD488] \uC544\uC774\uD15C\uC744 2\uAC1C \uC783\uB294\uB2E4.", "\uACE0\uB974\uACE4 \uC2AC\uB808\uC774\uC5B4: \uC5EC\uB7EC\uBD84\uC740 \uC1E0\uB85C \uB41C \uD53C\uBD80\t\uB97C \uC9C0\uB2CC \uC18C\uB97C \uBB3C\uB9AC\uCCE4\uB2E4! \uC804\uC6D0 \u3010\uC778\uACFC\uB825\u3011 1\uC810\uC744 \uC783\uB294\uB2E4. \uC804\uB9AC\uD488\uC73C\uB85C \u3010\uCCA0\uC6B0\uC758 \uBE44\uB298 [\uD658\uC804] (35G)\u3011\uB97C \uC778\uC6D0\uC218\uB9CC\uD07C \uC190\uC5D0 \uB123\uB294\uB2E4.", "\uAC1C\uCC99\uC790\uB4E4: \uBA87 \uBA85\uC758 \uB300\uC9C0\uC778\uC774 \uC232\uC744 \uAC1C\uAC04\uD558\uACE0 \uC788\uB2E4. \uC528\uB97C \uBFCC\uB9AC\uB824\uBA74 \uC870\uAE08 \uB354 \uAC78\uB9B4 \uAC83 \uAC19\uB2E4.", "\uC608\uC0C1 \uBC16\uC758 \uC870\uC6B0: 10m\uAC00 \uB118\uB294 \uB179\uC0C9 \uB4DC\uB798\uACE4\uACFC \uC6B0\uC5F0\uD788 \uB9C8\uC8FC\uCE5C\uB2E4. \uC65C \uC774\uB7F0 \uACF3\uC5D0! \uC5EC\uB7EC\uBD84\uC740 \uC804\uB825\uC744 \uB2E4\uD574 \uB3C4\uB9DD\uCCE4\uB2E4. \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 \u3010\uC778\uACFC\uB825\u3011\uC744 2\uC810 \uC783\uAC70\uB098, [\uBCF4\uC870\uC7A5\uBE44] \uD558\uB098\uC5D0 [\uD30C\uC190] \uD0DC\uADF8\uB97C \uC785\uB294\uB2E4. \uB458 \uB2E4 \uD560 \uC218 \uC5C6\uB2E4\uBA74 [\uD53C\uB85C: 35]\uB97C \uC785\uB294\uB2E4.", "\uB05D\uB9D0\uC787\uAE30\uB294 \uADC0\uBB38: \uC5EC\uB7EC\uBD84\uC740 \uC5EC\uD589\uC758 \uD765\uC744 \uB3CB\uC6B0\uAE30 \uC704\uD574 \uB2E4 \uD568\uAED8 \uB05D\uB9D0\uC787\uAE30\uB97C \uD558\uBA74\uC11C \uAC77\uACE0 \uC788\uB2E4. PC \uC804\uC6D0\uC740 \u300C\uB204\u300D(GM\uC740 \uB2E4\uB978\uAC78\uB85C \uBC14\uAFD4\uB3C4 \uC88B\uB2E4)\uB85C \uC2DC\uC791\uD558\uB294 \uB2E8\uC5B4\uB97C \uD558\uB098 \uBC1C\uD45C\uD55C\uB2E4. \uAC00\uC7A5 \uCC3D\uD53C\uD55C \uB2E8\uC5B4\uB97C \uBC1C\uD45C\uD55C PC\uB97C \uB2E4 \uD568\uAED8 \uACB0\uC815\uD55C\uB2E4. \uADF8 PC\uC5D0 \uB300\uD55C \uCEE4\uB125\uC158\uC744 \uAC00\uC9C0\uACE0 \uC788\uB294 \uB2E4\uB978 PC\uB294 \uCEE4\uB125\uC158\uC758 \uAD00\uACC4\uB97C [\uB3D9\uC815], [\uC2E4\uB9DD], [\uC7AC\uBBF8\uC788\uC74C]\uC73C\uB85C \uBCC0\uACBD\uD560 \uC218 \uC788\uB2E4.", "\uC624\uB798\uB41C \uC2E0\uC5ED: \uCEE4\uB2E4\uB780 \uC11D\uC81C \uD1A0\uB9AC\uC774\uAC00 \uC624\uB79C\uC138\uC6D4\uC758 \uD48D\uD30C\uB97C \uACAC\uB514\uBA70 \uC6B0\uB69D \uC19F\uC544\uC788\uB2E4. \uC8FC\uC704\uC5D0 \uC5C4\uC219\uD55C \uBD84\uC704\uAE30\uAC00 \uAC00\uB4DD\uD588\uB2E4.", "\uB09C\uAE30\uB958: \uB3CC\uD48D\uC740 \uD68C\uC624\uB9AC\uAC00 \uB418\uC5C8\uB2E4! \uC5EC\uB7EC\uBD84\uC740 \uAC04\uC2E0\uD788 \uD1B5\uACFC\uD560 \uC218 \uC788\uC5C8\uC9C0\uB9CC \uBA40\uCA61\uD558\uC9C0\uB294 \uC54A\uC558\uB2E4. \uC5EC\uB7EC\uBD84\uC740 [\uD53C\uB85C: 35]\uB97C \uC785\uAC70\uB098 [\uC18C\uBAA8\uD488] 2\uAC1C\uB97C \uC783\uB294\uB2E4(\uC5EC\uB7EC\uBD84\uC774 \uC120\uD0DD).", "\uB178\uB9AC\uB824\uBA74 \uC6D4\uCC99\uC744: \uC5EC\uB7EC\uBD84\uC740 \uBA4B\uC9C4 \uB09A\uC2DC\uD130\uB97C \uBC1C\uACAC\uD55C\uB2E4. \uD0D0\uC0C9\uC744 \uD558\uB294 PC\uB294 [\uC2DD\uB7C9] \uC544\uC774\uD15C\uC744 \uD558\uB098 \uC18C\uBE44\uD574\uC11C \uBAA9\uD45C\uCE58 13\uC758 [\uC870\uC791\uD310\uC815]\uC744 \uD55C\uB2E4(\uC5B4\uBD80\uB098 \uADF8\uC5D0 \uC900\uD558\uB294 \uC11C\uBE0C \uC9C1\uC5C5\uC5D0\uAC90 +2\uB97C \uC918\uB3C4 \uC88B\uB2E4). \uC131\uACF5\uD55C \uC0AC\uB78C\uC740\u300C\uAE30\uB984\uC774 \uC624\uB978 \uC1A1\uC5B4 (\uC815\uC11D \uCE74\uB808\uC5D0 \uC0C1\uB2F9)\u300D\uB97C [1D/2]\uB9C8\uB9AC(\uCD5C\uC800 1\uB9C8\uB9AC) \uC785\uC218\uD55C\uB2E4.", "\uACE0\uBAA9 \uBBF8\uAD81: \uC6B8\uD241\uBD88\uD241\uD55C \uACE0\uBAA9\uC774 \uC11C\uB85C \uC5BD\uD600 \uC555\uBC15\uAC10\uC744 \uB290\uB07C\uAC8C \uD55C\uB2E4. \uC232\uC774 \uBCF4\uB0B4\uC628 \uC138\uC6D4\uC758 \uBB34\uAC8C\uAC00 \uC5B4\uAE68\uB97C \uC9D3\uB204\uB974\uB294 \uB4EF\uD558\uB2E4.", "\uC911\uACFC\uBD80\uC801: \uC5EC\uB7EC\uBD84\uC740 \uBB34\uC218\uD55C \uAD6C\uB801\uC774\uC5D0\uAC8C \uB458\uB7EC\uC2F8\uC600\uB2E4! \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 [\uD53C\uB85C: 40]\uC744 \uC785\uAC70\uB098 \uBCF4\uC870\uC7A5\uBE44 \uD558\uB098\uC5D0 [\uD30C\uC190] \uD0DC\uADF8\uB97C \uBD99\uC778\uB2E4(\uC5EC\uB7EC\uBD84\uC774 \uC120\uD0DD).", "\uCD95\uBCF5\uC758 \uACE0\uB9AC: \uC5EC\uB7EC\uBD84\uC740 \uB300\uC9C0\uC778\uC758 \uB9C8\uC744\uC5D0\uC11C \uACB0\uD63C\uC744 \uCD95\uD558\uD558\uB294 \uC870\uCD10\uD55C \uC5F0\uD68C\uB97C \uC811\uD55C\uB2E4. \uCD95\uBCF5\uC744 \uD574\uC8FC\uACE0 \uC2F6\uB2E4\uBA74 \uB300\uD45C PC\uAC00 \uB09C\uC774\uB3C4 14\uC758 [\uAD50\uC12D] \uD310\uC815\uC744 \uD55C\uB2E4. \uC120\uBB3C\uB85C [\uC2DD\uB7C9] \uD0DC\uADF8\uB97C \uAC00\uC9C4 \uC544\uC774\uD15C\uC744 \uD558\uB098 \uB0B4\uB193\uC744 \uB54C\uB9C8\uB2E4 +2\uC758 \uBCF4\uB108\uC2A4\uB97C \uC5BB\uB294\uB2E4. \uC131\uACF5\uD55C \uACBD\uC6B0, \uC5B4\uB518\uAC00\uC5D0\uC11C \uC0C1\uCF8C\uD55C \uBC14\uB78C\uC774 \uBD88\uC5B4 \uC5EC\uB7EC\uBD84 \uC804\uC6D0\uC740 \u3010\uC778\uACFC\uB825\u3011 1\uC810\uC744 \uC5BB\uB294\uB2E4. \uADF8\uB807\uC9C0 \uC54A\uC740 \uACBD\uC6B0\uB77C\uB3C4 \uC5F0\uD68C\uC5D0\uB294 \uCD08\uB300\uBC1B\uC73C\uBA70, \uC18C\uBC15\uD55C \uB9CC\uCC2C\uC744 \uBA39\uACE0 \uC804\uC6D0\uC758 [\uD53C\uB85C]\uAC00 -20 \uC904\uC5B4\uB4E0\uB2E4.", "\uD070 \uAC15\uC744 \uC774\uB8E8\uB294 \uD55C \uBC29\uC6B8: \uAE68\uB057\uD55C \uBB3C\uC774 \uC138\uCC28\uAC8C \uC19F\uC544\uB09C\uB2E4. \uC774 \uBB3C\uC740 \uBD84\uBA85 \uC800 \uD070 \uAC15\uC73C\uB85C \uC774\uC5B4\uC9C8 \uAC83\uC774\uB2E4.", "\uB0C9\uB7AD\uD55C \uC0B0\uAE38: \uC5EC\uB7EC\uBD84\uC740 \uBC14\uB78C\uC774 \uC138\uCC28\uAC8C \uBD80\uB294, \uC5BC\uC5B4\uBD99\uC744 \uB4EF\uD55C \uC0B0\uAE38\uC744 \uAC78\uC5B4\uAC04\uB2E4. [\uACBD\uAC10(\uB0C9\uAE30)\uB97C \uAC00\uC9C0\uACE0 \uC788\uAC70\uB098, \uD639\uC740 \uC5BB\uC744 \uC218 \uC788\uB294 PC\uB294 \uC774 \uC601\uD5A5\uC744 \uBC1B\uC9C0 \uC54A\uB294\uB2E4. \uADF8\uB807\uC9C0 \uC54A\uC740 PC\uB294 \u3010\uC778\uACFC\uB825\u3011 2\uC810\uC744 \uC783\uAC70\uB098 \uBCF4\uC870\uC7A5\uBE44 \uD558\uB098\uC5D0 [\uD30C\uC190] \uD0DC\uADF8\uB97C \uC785\uB294\uB2E4(\uC5EC\uB7EC\uBD84\uC774 \uC120\uD0DD). \uC591\uCABD \uBAA8\uB450 \uC120\uD0DD\uD560 \uC218 \uC5C6\uB294 \uACBD\uC6B0, [\uD53C\uB85C: 50]\uC744 \uC785\uB294\uB2E4.", "\uACE0\uBE14\uB9B0\uC758 \uC57C\uC601\uC9C0: \uC5EC\uB7EC\uBD84\uC740 \uC57C\uC601 \uC911\uC778 \uACE0\uBE14\uB9B0\uB4E4\uC744 \uBB3C\uB9AC\uCCE4\uB2E4! \uC804\uC6D0 50G\uB97C \uC190\uC5D0 \uB123\uB294\uB2E4. \uBAA9\uD45C\uCE58 14\uC758 [\uC9C0\uAC01\uD310\uC815]\uC744 \uD55C\uB2E4(\uD55C\uC0AC\uB78C\uB2F9 1\uD68C). \uC131\uACF5\uD55C \uC0AC\uB78C\uC740 \u300C\uACE0\uBE0C \uC601\uC6C5\uC0C1[\uD658\uC804] (60G)\u300D\uC744 \uD558\uB098 \uC785\uC218\uD55C\uB2E4.", "\uC904\uACE7 \uC774\uC5B4\uC9C0\uB294 \uC0DD\uD65C: \uC0B0\uBE44\uD0C8\uC758 \uD55C \uBA74 \uC804\uCCB4\uC5D0 \uBC2D\uB4E4\uC774 \uACC4\uB2E8\uCC98\uB7FC \uD3BC\uCCD0\uC838 \uC788\uB2E4. \uC774 \uC815\uB3C4\uC758 \uB17C\uBC2D\uC744 \uC77C\uAD6C\uB294 \uB370 \uB3C4\uB300\uCCB4 \uC5BC\uB9C8\uB098 \uB9CE\uC740 \uC2DC\uAC04\uC774 \uB4E4\uC5C8\uC744\uAE4C? \uADFC\uCC98\uC5D0\uB294 \uD2C0\uB9BC\uC5C6\uC774 \u3008\uB300\uC9C0\uC778\u3009\uC758 \uB9C8\uC744\uC774 \uC788\uC744 \uAC83\uC774\uB2E4."];
